script: |
  super -f text -I q7328.spq | sort > q7328.out

inputs:
  - name: q7328.spq
    data: |
      SELECT DISTINCT + - 49 col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 NOT BETWEEN NULL AND - col0 / - + col2 * + col2 * CAST ( NULL AS INTEGER ) * + col2;
  - name: tab2

outputs:
  - name: q7328.out
    data: |
